import React from "react";
import Card from "./Card/Card";
import Full from "./Full/Full";
import './Logement.css'

export default function Logement({type, data}){
    return (
        <div>
            {type === 'card' ? 
                <Card data={data} className='cardList'/> 
            :   <Full data={data}/> 
            }
        </div>
    );
}
